import add from './assets/Add.svg'



export const Button = ({color, text}) =>{
    return(
        <div className="add_student_button">
        <div className="add_student_button_circle">
            <img src={add} alt='add button'></img>
        </div>
        <p className="add_student_button_text">add student</p>

        </div>
    )
}
